    "2016-01-16T06:27:48.294629",nt"name": "measurements-and-counts-for-larval-and-juvenile-bramidae-specimens",nt"isopen":
    false,nt"url": null,nt"notes": "Micronekton and plankton samples were collected
    at the Southeast (SE) Hancock Seamount  in 1985-1987, and in the vicinity of Palmyra
    Atoll, Line Islands in 1990. Micronekton samples were collected with a 1.8 m Isaacs-Kidd
    mid water trawl (IKMT), a 60 m2 Marinovich trawl (September and November 1986),
    and a 100 m2 Oregon State University (OSU) rope trawl (November 1988). Bramid eggs
    and larvae were collected in plankton samples using a 1 m2 opening-closing Tucker
    trawl (July 1984 and February 1985), a 0.49m2 Manta (neuston) net (January 1988),
    a 60cm bongo net (January 1988), and , and a 1 m2 MOCNESS with 0.333 mm mesh (Aug.
    1990). Samples were preserved in 10% formalin at sea and sorted for bramid larvae
    and juveniles in the laboratory. Bramid larvae and juveniles from the central Pacific
    were compared to eastern Pacific specimens of Bramidae from the California Cooperative
    Oceanic Fisheries Investigation (CALCOFI). Counts and measurements for larvae and
    juveniles were made using a dissecting microscope with an ocular micrometer.  Data
    were collected by Bruce Mundy (PIFSC), H. Geoffrey Moser (NMFS Southwest Fisheries
    Science Center), and Masato Moteki (Tokyo University of Marine Science and Technology).",nt"license_title":
